INSERT INTO article values (1, 'Hultafors TC 16 XL hammer', 'Hultafors', 'Hultafors TC 16', 'Suverent god hammer til utlån. Godt grep og god kvalitet.', 'Meget godt grep, noe glattere på vått, men sitter fremdeles.Pluss for at grepet kommer i flere størrelser.Kloas utforming gir suveren tilgjengelighet når du trekker ut spiker. Meget god avvibrering og lite tilbakeslag, lav og solid lyd. God utførelse på hodet gir ingen skarpe kanter og lite merker.Hammeren har meget god balanse og solid utførelse', 1, 'http://www.klikk.no/multimedia/archive/00480/hammer__yvind_lie_480130m.jpg', 1, 2 , current_timestamp, current_timestamp);
